import React, { Component } from 'react';

export default class AddProject extends Component {
    constructor(props){
        super(props);
        this.state = {
            name: '',
            tech: [],
            link: ''
        }
    }

    render() {
        return (
            <div className="primary col-8">
                <form>
                    <div className="form-group rounded">
                        <label for="name" value="name">Name</label>
                        <input className="form-control" type="text" name="name" id="project-name" />
                    </div>
                    <div className="form-group rounded">
                        <label for="tech" value="tech">Tech</label>
                        <input className="form-control" type="text" name="name" id="project-tech" />
                    </div>
                    <div className="form-group rounded">
                        <label for="link" value="link">Link</label>
                        <input className="form-control" type="text" name="name" id="project-link" />
                    </div>
                    <div className="form-group rounded">
                        <input className="btn btn-primary" type="submit" value="Add Project" id="project-submit" />
                    </div>
                </form>
            </div>
        );
    }
}
